import "./stylesheet.css"

function CardContainer(children) {
    return <div className="container-cards">
    <div className="content-card">{children}</div>
</div>
}

export default function Card (){
    /* Codigo js */
    return(
    <>
        {/* Esto es el HTML */ }
        <CardContainer><h1>Card</h1></CardContainer>
    </>
    )
}
